import { useState } from 'react'
import './style.css'

function Main() {
  const [email, setEmail] = useState('')
  return (
    <div>
      <form>
        <h1>Login</h1>
        <input
          type="text"
          placeholder="E-mail"
          value={email}
          onChange={(event) => setEmail}
        />
      </form>
    </div>
  )
}

export default Main
